site.headStyle:
.shadowed {
    /* stolen from old wix site */
    text-shadow: #c8c8c8 1px 1px 0px, #b4b4b4 0px 2px 0px, #a0a0a0 0px 3px 0px, rgba(140, 140, 140, 0.498039) 0px 4px 0px, #787878 0px 0px 0px, rgba(0, 0, 0, 0.498039) 0px 5px 10px;
}

.nav-link {
    text-decoration: none;
}

.nav-link:hover {
    text-decoration: underline;
}

.footer-button * {
    text-decoration: none;
    color: white;
}

.footer-text * {
    color: #b2d5bc;
}

.light-green-text * {
    color: rgb(116 169 139)
}

.dark-green-text * {
    color: rgb(52,89,62)
}

.white-text * {
    color: white;
}

.small-text * {
    font-size: 16px;
}
